import React from "react";
import "./Mainpage.css";

const Mainpage = () => {
  return (
    <div className="container">
      <h1>메인 페이지</h1>
      <button type="submit">질문 리스트</button>
      <button type="submit">MBTI 검사</button>
      <button type="submit">게시판</button>
      <button type="submit">내 프로필</button>
    </div>
  );
};

export default Mainpage;
